pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

//Import money-legos from github
import "@studydefi/money-legos/dydx/contracts/DydxFlashloanBase.sol";
import "@studydefi/money-legos/dydx/contracts/ICallee.sol";

//import ERC20 token functions
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

//Uniswap helper functions
import '@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol';

import "./IUniswapV2Router02.sol";
import "./IWeth.sol";
import "./BalancerExchangeProxy.sol";
//import "./TransferHelper.sol";
import { KyberNetworkProxy as IKyberNetworkProxy } from '@studydefi/money-legos/kyber/contracts/KyberNetworkProxy.sol';

contract Flashloan is ICallee, DydxFlashloanBase {

    address public wethAddress;
    uint public balancerNum;

    struct ArbInfo {
        address exchange1;
        address exchange2;
        uint256 repayAmount;
        address Token1;
        address Token2;
    }

    //Initialize other contracts
    IKyberNetworkProxy kyber;
    IUniswapV2Router02 uniswap;
    ExchangeProxy balancer;
    IUniswapV2Router02 sushiswap;
    address dydx;
    address payable owner;


    //Create modifier to limit who can call the contract
    modifier onlyOwner()
    {
        require(
            msg.sender == owner,
            "Sender not authorized."
        );
        // Do not forget the "_;"! It will
        // be replaced by the actual function
        // body when the modifier is used.
        _;
    }

    //Create address variables for relevant exchanges
    constructor(
        address kyberAddress,
        address uniswapAddress,
        address sushiswapAddress,
        address balancerAddress,
        address solo_
    )
    public 
    payable{
        kyber = IKyberNetworkProxy(kyberAddress);
        uniswap = IUniswapV2Router02(uniswapAddress);
        sushiswap = IUniswapV2Router02(sushiswapAddress);
        dydx = solo_;
        balancer = ExchangeProxy(balancerAddress);
        balancerNum = 3;
        //IERC20 is the ERC20 protocol contract
        owner = msg.sender;
        wethAddress = uniswap.WETH();

    }

    //Updates the number of balancer pools we use
    function updateBalancers(uint newBalancerNum) public onlyOwner {
        balancerNum = newBalancerNum;
    }

    //Withdraws any ethereum from the address
    function withdrawEth() public onlyOwner {
        owner.transfer(address(this).balance);
    }

    //Withdraw a specific ERC20 token
    function withdrawErc20(address token) external onlyOwner {
        IERC20 newToken = IERC20(token);
        newToken.transfer(owner, newToken.balanceOf(address(this)));
    }

    //Change the contract owner
    function changeOwner(address payable newOwner) external onlyOwner{
        owner = newOwner;
    }

    //This functions exchanges sellBalance of sellCoin for buyCoin
    function tradeOnUniswap(address sellCoin, address buyCoin, uint256 sellBalance) private {
        IERC20(sellCoin).approve(address(uniswap), sellBalance);

        address[] memory path = new address[](2);
        path[0] = sellCoin;
        path[1] = buyCoin;

        //uint[] memory minOuts = uniswap.getAmountsOut(sellBalance, path);
        uniswap.swapExactTokensForTokens(
            sellBalance,
            0,
            path,
            address(this),
            now
        );
    }

        //This functions exchanges sellBalance of sellCoin for buyCoin
    function tradeOnSushiSwap(address sellCoin, address buyCoin, uint256 sellBalance) private {
        IERC20(sellCoin).approve(address(sushiswap), sellBalance);

        address[] memory path = new address[](2);
        path[0] = sellCoin;
        path[1] = buyCoin;

        //uint[] memory minOuts = sushiswap.getAmountsOut(sellBalance, path);
        sushiswap.swapExactTokensForTokens(
            sellBalance,
            0,
            path,
            address(this),
            now
        );
    }


    function tradeOnKyber(address sellCoin, address buyCoin, uint256 sellBalance) private {
        IERC20(sellCoin).approve(address(kyber), sellBalance);

        // (uint256 expectedRate, uint256 worstRate) = kyber.getExpectedRate(
        //     IERC20(sellCoin),
        //     IERC20(buyCoin),
        //     sellBalance
        // ); DONT NEED THIS CAUSE WE ACCEPT 0 RATE

       kyber.swapTokenToToken(
           IERC20(sellCoin), 
           sellBalance, 
           IERC20(buyCoin), 
           0 //Min Output amount
        );
    }


    function tradeOnBalancer(address sellCoin, address buyCoin, uint256 sellBalance) private {
        IERC20(sellCoin).approve(address(balancer), sellBalance);

        balancer.smartSwapExactIn(
        TokenInterface(sellCoin),
        TokenInterface(buyCoin),
        sellBalance, // maxAmountIn, set to max -> use all sent ETH
        0, // Min out 0 means we accept any amount
        3 // max pools
    );

    }


    // This is the function that will be called postLoan
    // i.e. Encode the logic to handle your flashloaned funds here
    function callFunction(
        address sender,
        Account.Info memory account,
        bytes memory data
    ) public{
        require(msg.sender == dydx, "Callback was not called by dydx");

        ArbInfo memory arbInfo = abi.decode(data, (ArbInfo)); //Decode custom passed data (sent through dydx)

        uint256 Token1Balance = IERC20(arbInfo.Token1).balanceOf(address(this)); //This balance is from the flash loan of token1

        if(arbInfo.exchange1 == address(kyber)){
            tradeOnKyber(arbInfo.Token1, arbInfo.Token2, Token1Balance);
        }
        else if (arbInfo.exchange1 == address(uniswap)){
            tradeOnUniswap(arbInfo.Token1, arbInfo.Token2, Token1Balance);
        }
        else if(arbInfo.exchange1 == address(sushiswap)){
            tradeOnSushiSwap(arbInfo.Token1, arbInfo.Token2, Token1Balance);
        }
        else if(arbInfo.exchange1 == address(balancer)){
            tradeOnBalancer(arbInfo.Token1, arbInfo.Token2, Token1Balance);
        }

        uint256 Token2Balance = IERC20(arbInfo.Token2).balanceOf(address(this)); //Get new balance of token 2 after trade

        if(arbInfo.exchange2 == address(kyber)){
            tradeOnKyber(arbInfo.Token2, arbInfo.Token1, Token2Balance);
        }
        else if(arbInfo.exchange2 == address(uniswap)){
            tradeOnUniswap(arbInfo.Token2, arbInfo.Token1, Token2Balance);
        }
        else if(arbInfo.exchange2 == address(sushiswap)){
            tradeOnSushiSwap(arbInfo.Token2, arbInfo.Token1, Token2Balance);
        }
        else if(arbInfo.exchange2 == address(balancer)){
            tradeOnBalancer(arbInfo.Token2, arbInfo.Token1, Token2Balance);
        }

        uint profit = IERC20(arbInfo.Token1).balanceOf(address(this)) - arbInfo.repayAmount; 

        //Loan must be repayed or contract wont execute
        require(
            profit >= 0,
            "Not Enough funds to repay dydx loan"
        );

        //Sell to WETH
        if(arbInfo.Token1 != wethAddress){
        tradeOnUniswap(arbInfo.Token1, wethAddress, profit);
        IERC20(wethAddress).transfer(owner, IERC20(wethAddress).balanceOf(address(this)));
        }else{
        IERC20(wethAddress).transfer(owner, profit);
        }

    }

    //This is the function that initiates the arbitrage play
    //It withdraws the flashloan from dydx and then calls the callFunction in this contract and then deposits the flashloan back
    function initiateFlashLoan(
        address _solo, 
        address _Token1, 
        address _Token2, 
        uint256 _amount,
        address _exchange1,
        address _exchange2)
        external onlyOwner
    {
        ISoloMargin solo = ISoloMargin(_solo);

        // Get marketId from token address
        uint256 marketId = _getMarketIdFromTokenAddress(_solo, _Token1);

        // Calculate repay amount (_amount + (2 wei))
        // Approve transfer from
        uint256 repayAmount = _getRepaymentAmountInternal(_amount);
        IERC20(_Token1).approve(_solo, repayAmount);

        // 1. Withdraw $
        // 2. Call callFunction(...)
        // 3. Deposit back $
        Actions.ActionArgs[] memory operations = new Actions.ActionArgs[](3);

        operations[0] = _getWithdrawAction(marketId, _amount);
        operations[1] = _getCallAction(
            // Encode MyCustomData for callFunction
            abi.encode(ArbInfo({exchange1: _exchange1, exchange2: _exchange2, repayAmount: repayAmount, Token1: _Token1, Token2: _Token2}))
        );
        operations[2] = _getDepositAction(marketId, repayAmount);

        Account.Info[] memory accountInfos = new Account.Info[](1);
        accountInfos[0] = _getAccountInfo();

        solo.operate(accountInfos, operations);
    }

    function() external payable {}
}
